var Asteroids = function(lpcanvas,lpasteroids,lpplanets=10,lpbackground = "rgb(0,0,0)"){
	this.Asteroids = {
		Canvas : document.getElementById(lpcanvas),
		AsteroidsCount : lpasteroids,
		AsteroidsList : [],
		Stars : [],
		Mouse : {x: null,y: null,radius: 200},
		PlanetsImgUrl : "data:image/png;base64,",
		PlanetsImg : new Image(),
		PlanetsCount : lpplanets,
		PlanetsList : []
	}
	Asteroids.PlanetsImg.src =  Asteroids.PlanetsImgUrl;
	Asteroids.Context = Asteroids.Canvas.getContext("2d");
	Asteroids.Canvas.style.background = lpbackground;
	Asteroids.CanvasPosition = Asteroids.Canvas.getBoundingClientRect();

	
	Asteroids.loop = function() {
		Asteroids.Context.clearRect(0, 0, Asteroids.Canvas.width, Asteroids.Canvas.height);
		Asteroids.StarsDraw();
		for (var i= 0;i< Asteroids.AsteroidsList.length;i++) {
			Asteroids.AsteroidsList[i].Asteroid.Update();
			Asteroids.AsteroidsList[i].Asteroid.Draw();
		}
		for (var i= 0;i< Asteroids.PlanetsList.length;i++) {
			Asteroids.PlanetsList[i].Planet.Update();
			Asteroids.PlanetsList[i].Planet.Draw();
		}
		requestAnimationFrame(Asteroids.loop);
	};
	Asteroids.MousePosition = function(){
		window.addEventListener('mousemove', 
			function(e){
				Asteroids.Mouse.x = e.x - Asteroids.CanvasPosition.left;
				Asteroids.Mouse.y = e.y - Asteroids.CanvasPosition.top;
		});
	};
	Asteroids.GetRandomColor = function(){
		var r = 0, g = 0, b = 0;
		//r = Math.floor(Math.random() * 156+100);
		//g = Math.floor(Math.random() * 156+100);
		//b = Math.floor(Math.random() * 156+100);
		r = 255;
		g = Math.floor(Math.random() * 56+200);
		b = Math.floor(Math.random() * 56+200);
		return "rgba(" + r + "," + g + ","  + b + ",0.4)";
	};
	Asteroids.StarsDraw = function(){
		Asteroids.Context.fillStyle = "rgb(255,255,255)";
		for (var i= 0;i< Asteroids.Stars.length;i++) {
			Asteroids.Context.beginPath();
			Asteroids.Context.arc(Asteroids.Stars[i].x, Asteroids.Stars[i].y, Math.random()*2, 0, Math.PI*2, true);
			Asteroids.Context.closePath();
			Asteroids.Context.fill();
		}
	};
	Asteroids.Planet = function(){
		//x2/a2   + y2/b2 = 1 
		this.Planet = {
			Radio : Math.round(Math.random()*20 + 15),
			PlanetaX : Math.round(Math.random()*9),
			PlanetaY : Math.round(Math.random()*6),
			PosX : 0,
			PosY :  0,
			MaxY : ((Asteroids.Canvas.height-50) * Math.random()/2) +50,
			MaxX : 0 ,
			Angulo : Math.round(Math.random()*360),
			Speed : Math.random()*0.05 + 0.01
		};
		this.Planet.MaxX =  (this.Planet.MaxY*100/Asteroids.Canvas.height)*Asteroids.Canvas.width/100
		this.Planet.Draw = function() {
			Asteroids.Context.drawImage(Asteroids.PlanetsImg,this.PlanetaX*38,this.PlanetaY*33,38,33,this.PosX-this.Radio/2,this.PosY-this.Radio/2,this.Radio,this.Radio);
		}
		this.Planet.Update = function() {
			
			
			this.Angulo += this.Speed;
			if (this.Angulo > 360){
				this.Angulo = this.Angulo - 360;
			}
			
			this.PosX = Asteroids.Canvas.width/2 + this.MaxX* (Math.cos(this.Angulo*Math.PI/180) )
			this.PosY = Asteroids.Canvas.height/2 + this.MaxY* (Math.sin(this.Angulo*Math.PI/180) )
			

		};
		
	};
	Asteroids.Asteroid = function(){
		this.Asteroid = {
			x : Asteroids.Canvas.width * Math.random(),
			y : Asteroids.Canvas.height * Math.random(),
			xi : 0,
			yi : 0,
			angle : Math.round(Math.random()*360),
			size : Math.random()*4+1,
			Color : Asteroids.GetRandomColor(),
			LastPos : []
		}
		this.Asteroid.Redeploit = function(){
			this.x = Asteroids.Canvas.width * Math.random();
			this.y = 1;
			this.xi = 0;
			this.yi = 0;
			this.angle = Math.round(Math.random()*90);
			this.size = Math.random()*4+1;
			this.Color = Asteroids.GetRandomColor();
			for(var i=0;i<20;i++){
				this.LastPos[i]={x:this.x,y:this.y};
			}
		}
		this.Asteroid.Draw = function() {
			for(var i = 0; i < this.LastPos.length; i++){
				Asteroids.Context.beginPath();
				Asteroids.Context.fillStyle = this.Color;
				Asteroids.Context.arc(this.LastPos[i].x, this.LastPos[i].y, ((i)/10), 0, Math.PI*2, true);
				//Asteroids.Context.arc(Asteroids.Mouse.x, Asteroids.Mouse.y, 30, 0, Math.PI*2, true);
				Asteroids.Context.closePath();
				Asteroids.Context.fill();
			}
		}
		this.Asteroid.Update = function() {
			//define points of triangle
			//this.xi = this.x;
			//this.yi = this.y
			this.xi = this.LastPos[10].x;
			this.yi = this.LastPos[10].y;
			this.x += this.size*Math.sin(this.angle*(Math.PI / 180));
			this.y += this.size*Math.cos(this.angle*(Math.PI / 180));
			//Update the 10 points to write
			this.LastPos.splice(0,1)
			this.LastPos.push({x:this.x,y:this.y})
			//calc len between pointer and current position and if lower than radius affect trayect
			let diagb = Math.sqrt(Math.pow((Asteroids.Mouse.x - this.x),2) + Math.pow((Asteroids.Mouse.y - this.y),2));
			if(diagb < Asteroids.Mouse.radius){
				if(diagb < 5){
					this.Redeploit();
				}else{
					//validate angles
					let AstX = Asteroids.Mouse.x-this.xi;
					let AstY = -(Asteroids.Mouse.y-this.yi);
					let AstDiag = Math.sqrt(Math.pow((AstX),2) + Math.pow((AstY),2));
					
					let AStAngSen = (Math.asin(AstY/AstDiag)/(Math.PI / 180));
					let AStAngTan = (Math.atan(AstY/AstX)/(Math.PI / 180));
					
					switch (true) {
						case (Math.sign(AStAngSen) == 1 && Math.sign(AStAngSen) == Math.sign(AStAngTan)):
							AStAngSen += 90;
							break;
						case (Math.sign(AStAngSen) == -1 && Math.sign(AStAngSen) == -Math.sign(AStAngTan)):
							AStAngSen = ((90-AStAngSen)+180);
							break;
						case (Math.sign(AStAngSen) == -1 && Math.sign(AStAngSen) == Math.sign(AStAngTan)):
							AStAngSen += 90;
							break;
						case (Math.sign(AStAngSen) == 1 && Math.sign(AStAngSen) == -Math.sign(AStAngTan)):
							AStAngSen = ((90-AStAngSen)+180);
							break;
						default:
							break;
					}
					let angle1fix = (this.angle+180<AStAngSen) ? this.angle+360: this.angle;
					let angle2fix = (this.angle-180>AStAngSen) ? AStAngSen+360 : AStAngSen;
					if(angle2fix<angle1fix){
						this.angle  -= (this.angle>0)? 1:-358;
					}
					else if(angle2fix>angle1fix){
						this.angle  += (this.angle<360)? 1:-360;
					}
					if(this.size>0.5)
						this.size-=0.001;
				}
			}else{
				
				if(this.x < 0){
					this.x=0;
					this.angle += ((this.angle<=270)?-90:0)+((this.angle>270)?90:0);
				}
				if (this.x > Asteroids.Canvas.width){
					this.x=Asteroids.Canvas.width;
					this.angle += ((this.angle<=90)?-90:0)+((this.angle>90)?90:0);
				}
				if (this.y < 0){
					this.y =0;
					this.angle += ((this.angle<=180)?-90:0)+((this.angle>180)?90:0);
				}
				if (this.y > Asteroids.Canvas.height){
					this.y = Asteroids.Canvas.height;
					this.angle += ((this.angle<=180)?+90:0)+((this.angle>180)?-90:0);
				}
			}
			this.angle += ((this.angle > 360)? -360 : 0 ) +  ((this.angle < 0)? +360 : 0 )
		};
		for(var i=0;i<20;i++){
			this.Asteroid.LastPos.push({x:this.Asteroid.x,y:this.Asteroid.y});
		}
		
	};
	for (var i = 0; i < 200; i++){
		Asteroids.Stars.push({x:Asteroids.Canvas.width * Math.random(),y:Asteroids.Canvas.height * Math.random()});
	};
	for (var i = 0; i < Asteroids.AsteroidsCount; i++){
		let AsteroideActual = new Asteroids.Asteroid();
		Asteroids.AsteroidsList.push(AsteroideActual);
	};
	for (var i = 0; i < Asteroids.PlanetsCount; i++){
		let PlanetaActual = new Asteroids.Planet();
		Asteroids.PlanetsList.push(PlanetaActual);
		if(i == 0){
			Asteroids.PlanetsList[0].Planet.PosX = Asteroids.Canvas.width/2;
			Asteroids.PlanetsList[0].Planet.PosY = Asteroids.Canvas.height/2;
			Asteroids.PlanetsList[0].Planet.MaxY = 0;
			Asteroids.PlanetsList[0].Planet.MaxX = 0;
			Asteroids.PlanetsList[0].Planet.Radio = 60;
			Asteroids.PlanetsList[0].Planet.PlanetaX = 9;
			Asteroids.PlanetsList[0].Planet.PlanetaY = 2;
		}
	};
	Asteroids.MousePosition();
	Asteroids.loop();
};

 document.getElementById("example2").width = window.innerWidth;
 document.getElementById("example2").height = window.innerHeight;

var asteroides = Asteroids("example2",40,10);



